function IncDec(){

    //let number=0

    const[number,setNumber]=useState(0)

    const increment=()=>{
       setNumber(number+1)
       // console.log(number+1);
    }

    return(
        <div>
            <p>Number is : {number}</p>
            <button type="button" onClick={increment}>Add</button>
        </div>
    )
}

export default IncDec
